import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./Slide.css"
import dummySool from "../static/dummyData";
import ProductCard from "./ProductCard";

// import required modules
import { Pagination, Navigation } from "swiper";

export default function Slide() {
    const sool = {
        id: 1220,
        name: '마실꾸지',
        img: `https://www.sooldamhwa.com/_next/image?url=https%3A%2F%2Fd38cxpfv0ljg7q.cloudfront.net%2Fadmin_contents%2Fthumbnail%2Fa7pq-1649400825257-1.jpg&w=3840&q=75`
      }
  return (
    <>
      <Swiper
        slidesPerView={3}
        spaceBetween={30}
        slidesPerGroup={3}
        loop={true}
        loopFillGroupWithBlank={true}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        {dummySool.map((sool) => <SwiperSlide key={sool.id}><ProductCard sool={sool}/></SwiperSlide>)}
      </Swiper>
    </>
  );
}
